import { useEffect } from "react";

const GeoapiScript = () => {
  useEffect(() => {
    const script = document.createElement("script");
    script.src =
      "//dapi.kakao.com/v2/maps/sdk.js?appkey=aec74c7c6f08fb8f0275ca0bd5520cfd&libraries=services";
    script.async = true;
    document.body.appendChild(script);
  });
};

export default GeoapiScript;
